port: 7890
socks-port: 7891
redir-port: 7892  #默认redir端口
allow-lan: true
mode: Rule
log-level: warning
external-controller: 127.0.0.1:9090

dns:
  enable: true
  ipv6: false
  listen: 0.0.0.0:55  #监听路由器55端口
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  #enhanced-mode: redir-host
  nameserver:
    - 119.29.29.29
    - 223.5.5.5
    - 223.6.6.6
    - 182.254.116.116
    - 114.114.114.114
    - 223.5.5.5
    - tls://dns.rubyfish.cn:853
  fallback:
    - 114.114.114.114
    - tls://dns.rubyfish.cn:853
    - 8.8.8.8


# 代理节点
proxies: ~

# 代理组策略
proxy-groups:
  - name: 节点选择
    type: select
    proxies:
      - ✈ 延迟最低
      - ✈ 手动选择
      - ✈ 故障切换
      - DIRECT
      - "1"
  - name: 国外媒体
    type: select
    proxies:
      - 节点选择
      - ✈ 手动选择
      - ✈ 延迟最低
      - ✈ 故障切换
      - DIRECT
  - name: 国内媒体
    type: select
    proxies:
      - DIRECT
      - 节点选择
      - ✈ 手动选择
      - ✈ 延迟最低
  - name: 广告拦截
    type: select
    proxies:
      - REJECT
      - DIRECT
  - name: final
    type: select
    proxies:
      - 节点选择
      - ✈ 手动选择
      - ✈ 延迟最低
      - ✈ 故障切换
      - DIRECT
  - name: ✈ 手动选择
    type: select
    proxies:
      - "1"
  - url: http://www.gstatic.com/generate_204
    interval: 500
    name: ✈ 延迟最低
    type: url-test
    proxies:
      - "1"
  - url: http://www.gstatic.com/generate_204
    interval: 500
    name: ✈ 故障切换
    type: fallback
    proxies:
      - "1"

